import React, { useEffect, useState } from "react";
import axios from "axios";
import { ChevronDown, ChevronUp } from "lucide-react";
import { useNavigate } from "react-router-dom";

const UserViewDrivers = () => {
  const [drivers, setDrivers] = useState([]);
  const [sortOrder, setSortOrder] = useState("asc");
  const [filterText, setFilterText] = useState("");
  const navigate = useNavigate();

  const currentUser = JSON.parse(localStorage.getItem("user")) || null;
  const token = localStorage.getItem("token");

  useEffect(() => {
    if (!token) {
      alert("Please login first");
      navigate("/");
      return;
    }
    axios
      .get("http://localhost:5000/api/driver")
      .then((res) => setDrivers(res.data))
      .catch(() => alert("Failed to fetch drivers"));
  }, [navigate, token]);

  const sortedDrivers = [...drivers].sort((a, b) => {
    const placeA = a.place.toLowerCase();
    const placeB = b.place.toLowerCase();
    return sortOrder === "asc" ? placeA.localeCompare(placeB) : placeB.localeCompare(placeA);
  });

  const filteredDrivers = sortedDrivers.filter((driver) =>
    driver.place.toLowerCase().includes(filterText.toLowerCase())
  );

  const handleBookNow = async (phone, driverUsername) => {
    if (!token) {
      alert("You must be logged in to book.");
      return;
    }

    try {
      await axios.post(
        "http://localhost:5000/api/book-now",
        { phone, driverUsername },
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      alert("Booking request sent!");
    } catch (err) {
      alert("Failed to send booking request.");
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    alert("Logged out successfully");
    navigate("/");
  };

  return (
    <div className="container" style={{ padding: "20px" }}>
      <h2>Welcome, {currentUser?.name || "User"}!</h2>
      <button onClick={handleLogout} style={{ marginBottom: "15px" }}>
        Logout
      </button>

      <input
        type="text"
        placeholder="Search by place"
        value={filterText}
        onChange={(e) => setFilterText(e.target.value)}
        style={{ marginBottom: "15px" }}
      />
      <button
        onClick={() => setSortOrder(sortOrder === "asc" ? "desc" : "asc")}
        style={{ marginBottom: "15px" }}
      >
        Sort by place {sortOrder === "asc" ? <ChevronDown /> : <ChevronUp />}
      </button>

      {filteredDrivers.map((driver) => (
        <div
          key={driver._id}
          style={{
            display: "flex",
            backgroundColor: "yellow",
            marginBottom: "15px",
            borderRadius: "10px",
            padding: "10px",
          }}
        >
          {/* Left: profile picture + username */}
          <div style={{ flex: 1, display: "flex", alignItems: "center" }}>
            <img
              src={driver.profilePicUrl || "https://via.placeholder.com/80"}
              alt="Profile"
              style={{ width: "80px", height: "80px", borderRadius: "50%" }}
            />
            <div style={{ marginLeft: "10px" }}>
              <h3>{driver.username}</h3>
            </div>
          </div>

          {/* Center: personal details */}
          <div style={{ flex: 2 }}>
            <p>Email: {driver.email}</p>
            <p>Place: {driver.place}</p>
            <p>Phone: +91 {driver.phone}</p>
          </div>

          {/* Right: graph placeholder */}
          <div
            style={{
              flex: 1,
              backgroundColor: "black",
              borderRadius: "10px",
              marginLeft: "10px",
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              color: "white",
            }}
          >
            Graph placeholder
          </div>

          {/* Book Now button */}
          <div style={{ marginLeft: "10px", display: "flex", alignItems: "center" }}>
            <button onClick={() => handleBookNow(driver.phone, driver.username)}>Book Now</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default UserViewDrivers;
